        width: "400px",
    }
})
const Signup = () => {
    const classes= useStyles();
    return (
        <form className={classes.root}>
        <h1>ユーザー登録ページ</h1>
        <TextField fullWidth label="e-mail" variant="outlined"/>
        <TextField fullWidth label="パスワード" variant="filled"/>
        <Button variant="contained">ボタン</Button>
        </form>
    )
};

export default Signup;
